import { ChangeDetectorRef, Component, ElementRef, inject, OnInit, ViewChild } from '@angular/core';
import { CommonFunctionService } from '../../../Services/CommonFunction/common-function.service';
import { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';
import { ActivatedRoute, Router } from '@angular/router';
import { NgbModal } from '@ng-bootstrap/ng-bootstrap';
import { ToastrService } from 'ngx-toastr';
import { SweetAlert2 } from '../../../Common/SweetAlert2';
import { AadharEsignService } from '../../../Services/BTER/AadharEsign/aadhar-esign.service';
import { SSOLoginDataModel } from '../../../Models/SSOLoginDataModel';
import { EnumRole, EnumStatus } from '../../../Common/GlobalConstants';
import { DomSanitizer, SafeHtml } from '@angular/platform-browser';
import { GetSignedPDFModel, GetSignedXMLModel } from '../../../Models/BTER/AadharEsignModel';
import { CookieService } from 'ngx-cookie-service';

@Component({
  selector: 'app-aadhar-esign',
  standalone: false,
  templateUrl: './aadhar-esign.component.html',
  styleUrl: './aadhar-esign.component.css'
})
export class AadharEsignComponent implements OnInit {

  public Table_SearchText: string = "";
  public isSubmitted: boolean = false;
  public IsView: boolean = false;
  public State: number = 0;
  public Message: string = '';
  public ErrorMessage: string = '';

  public sSOLoginDataModel = new SSOLoginDataModel();
  public _enumrole = EnumRole;
  public _enumStatus = EnumStatus;

  public getSignedXMLRequest = new GetSignedXMLModel();
  public getSignedPDFRequest = new GetSignedPDFModel();



  constructor(private commonMasterService: CommonFunctionService,
    private formBuilder: FormBuilder,
    private activatedRoute: ActivatedRoute,
    private routers: Router,
    private modalService: NgbModal,
    private toastr: ToastrService,
    private Swal2: SweetAlert2,
    private aadharEsignService: AadharEsignService,
    private cdr: ChangeDetectorRef,
    private cookieService: CookieService
  ) {

  }

  async ngOnInit() {
    this.sSOLoginDataModel = await JSON.parse(String(localStorage.getItem('SSOLoginUser')));
    
    let txn = this.cookieService.get("kd-esign");//get
    //let txn = = this.activatedRoute.snapshot.queryParams['txn'] ?? "0";

    if (txn?.length > 10) {
      //api call back
      this.getSignedPDFRequest.Txn = txn;
      this.cookieService.delete("kd-esign");//delete
      await this.GetSignedPDF();
    }
  }

  async GetSignedXML() {
    try {
      this.getSignedXMLRequest.base64PdfFile = "";

      this.getSignedXMLRequest.designation = "Govt";
      this.getSignedXMLRequest.location = "Jaipur, Rajasthan, IN";
      this.getSignedXMLRequest.ModifyBy = this.sSOLoginDataModel.UserID;
      this.getSignedXMLRequest.UserNameInAadhar = "Brijraj Sharma";

      await this.aadharEsignService.GetSignedXML(this.getSignedXMLRequest).
        then((res: any) => {

        })
    } catch (error) {
      console.error(error)
    }
  }

  async GetSignedPDF() {
    try {

      this.getSignedPDFRequest.ModifyBy = this.sSOLoginDataModel.UserID;
      //call
      await this.aadharEsignService.GetSignedPDF(this.getSignedPDFRequest).
        then((res: any) => {
          if (res.State == this._enumStatus.Success) {
            let data = res.Data;
            if (data.fileName != null) {
              this.toastr.success(res.Message);
            }
            else {
              this.toastr.error(data.responseMsg);
            }
          }
          else {
            this.toastr.error(res.ErrorMessage);
          }
        })
    } catch (error) {
      console.error(error)
    }
  }

}

